ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Opel Astra wyprodukowany w 2005 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1910 cm3, legitymujący się mocą 120 KM, który pokonał do tej pory 233000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Opel prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane, komfortu dodaje sprawna chłodząca klimatyzacja. Na 17 calowe zostały założone nowe opony całosezonowe.



Astra jest wyposażenia w:

- Klimatyzacja;

- 17 calowe alufelgi;

- Panoramiczny dach otwierany;

- Lampy xenonowe;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie;

- Elektryczne lusterka;

- 4 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 02.08.2025 roku.

Przegląd techniczny 20.06.2026 roku.
